import React from "react";
import PropTypes from "prop-types";
import { Route, Switch, withRouter } from "react-router";
import "./styles.module.scss";
import Main from "../Main";
import Setting from "../Setting";
import { connect } from "react-redux";
import Navigation from "../Navigation";
import Summoner from "../Summoner";
import MSummoner from "../MSummoner";
import MultiSearch from "../MultiSearch";
import MInfo from "../MInfo";
import {
  BrowserView,
  MobileView,
  isBrowser,
  isMobile
} from "react-device-detect";

const App = props => (
  <Switch>
    
    {isBrowser && 
      <Route path="/multisearch" component={MultiSearch} />
    }
    {isMobile && 
      <Route path="/multisearch" component={MInfo} />
    }
    {isBrowser && 
      <Route path="/summoner/:summonername" component={Summoner} />
    }
    {isMobile && 
      <Route path="/summoner/:summonername" component={MSummoner} />
    }
    <Route path="/:any">
      <MainRoutes key={1} />
    </Route>
    <Route path="/">
      <MainRoutes key={1} />
    </Route>
  </Switch>
  
);

const MainRoutes = props => [
  <Main/>
];
const PublicRoutes = props => [
  <Navigation key={1} />,
  <Switch>
    <Route path="/summoner/:summonername" component={Summoner}>
      <Summoner key={2}/>
    </Route>
  </Switch>
  
];

App.propTypes = {

};


export default withRouter(connect()(App))
